Black Mamba: Kiss of Death

Nature Documentary hosted by Daryl Hannah, published by Smithsonian Channel in 2013 - English narration


Information
------------------------------

The bite of the black mamba is known by South African locals as the &quot;kiss of death.&quot; A single strike can deliver enough neurotoxic venom to kill 15 grown men. It has one of Africa's worst reputations, but does it deserve its bad rap? Behind the bad press lies a mercurial reptile that is quite shy. Follow a female mamba looking for a home to incubate her eggs while avoiding her main enemy: humans. Then join snake bounty hunter Simon Keys, whose black mamba sanctuary offers a unique look at the secret behavior of this much-maligned snake.

